import styled from "styled-components";

const StyledError = styled.div`
  background: rgba(255, 255, 255, 0.5) url("https://www.pngkit.com/png/detail/798-7987663_picture-teenage-drinking-diary-of-a-parish-priest.png") 
    no-repeat center
  width: 100%;
  height: 40rem;
`;

const StyledWrapper = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
`;

const ErrorPage = () => {
  return (
    <StyledError>
      <StyledWrapper>
        <div>oops... page is not found!</div>
        <div>This page is empty just like your drink.</div>
        <p>404</p>
        <div>Don't worry! Just follow the link below to back home page</div>
        <button>Go back to Home Page</button>
      </StyledWrapper>
    </StyledError>
  );
};

export default ErrorPage;
